import React from "react";
import "./styles/admin.css";
import "antd/dist/antd.css";
import { Spin } from "antd";

const Admin = () => {
  if (loading) {
    return (
      <div
        style={{
          margin: 0,
          padding: 0,
          height: "100vh",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          background: "#ececec",
        }}
      >
        <Spin tip="Loading...."></Spin>
      </div>
    );
  }
  return <div className="admin_panel"></div>;
};

export default Admin;
